import React, { useState } from 'react';

function MyPalettes() {
  const [paletteName, setPaletteName] = useState('');

  const styleButton = {
    backgroundColor: 'black',
    color: 'white',
    padding: '10px 20px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '10px',
  };

  const createPalette = () => {
    console.log('Create Palette:', paletteName);
  };

  const handlePaletteNameChange = (event) => {
    setPaletteName(event.target.value);
  };

  return (
    <div>
      <h1>My Palettes</h1>

      <input
        type="text"
        placeholder="Palette Name"
        value={paletteName}
        onChange={handlePaletteNameChange}
      />

      <button onClick={createPalette} style={styleButton}>
        Create Palette
      </button>
    </div>
  );
}

export default MyPalettes;
